import React from 'react';
import styled from 'styled-components'              

const Header = (props) => {
    return (

        <HeaderContainer>

        <HeaderImg className='image-container'>
            <img src={props.headerImage} alt='Header'/>
            <HeaderIntro>
            <h1>{props.headertitle}</h1>
            <p>{props.headerdescription}</p>
            </HeaderIntro>
        </HeaderImg>

        </HeaderContainer>

        
    )
};

const HeaderContainer = styled.div`



`
const HeaderIntro = styled.div`
height: 600px;
position: absolute;
background-color: rgb(rgb(42,42,42, 0.5));
background-color: yellow;
z-index: 3;
top: 0;
`

const HeaderImg = styled.div`
max-width: 100vw;
height: 400px;
position: relative;

img {
    width:100%;
    height:100%;
    object-fit:cover;
    z-index: 2;
}



`

export default Header;
